import React, { useState } from "react";
import axios from "axios";

// styles
import { StyledBookingInput, StyledBookingForm, StyledButton, MyBody } from "../AdminEndpoint/Admin.styles";

//Url
import { createUrl } from '../../../settings';

const initialState = {
    washerName: "",
    language: "",
    yearsOfExp: "",
    priceHour: ""
}

const AdminEndpoint = () => {
    const [response, setResponse] = useState('');
    const [newAssistant, setnewAssistant] = useState({});


    const handleChange = (e) => {
        setnewAssistant({
            ...newAssistant,
            [e.target.id]: e.target.value,
        });
    };

const handleSubmit = (e) =>{
    e.preventDefault();
    axios.post(`${createUrl}`, newAssistant)
    .then((response) => {
        setResponse(response.data);
    }      
    
)};

return (
    <MyBody>
      <StyledBookingForm>
        <StyledBookingInput 
            type="String"
            id='washerName'
            value={newAssistant.washerName}
            onChange={handleChange}
        ></StyledBookingInput>
        
            <StyledBookingInput 
            type="String"
            id='language'
            value={newAssistant.language}
            onChange={handleChange}
            ></StyledBookingInput>

        <StyledBookingInput 
            type="String"
            id='yearsOfExp'
            value={newAssistant.yearsOfExp}
            onChange={handleChange}
        ></StyledBookingInput>

        <StyledBookingInput 
            type="String"
            id='priceHour'
            value={newAssistant.priceHour}
            onChange={handleChange}
        ></StyledBookingInput>

            <StyledButton onClick={handleSubmit}>
            Confirm      
            </StyledButton>
      </StyledBookingForm>
    </MyBody>
    );
};

export default AdminEndpoint;
